We are an independent initiative of students and dedicated doctors, which is supported by many doctors, nurses, psychotherapists, midwives and interpreters in Dresden.
Our primary goal is to allow migrants without documents in Dresden and surrounding areas access to health care because it is not guaranteed by the state.
The right to adequate medical care is a human right, which is de facto kept back from people without documents at the moment. Also for asylum seekers there is only limited medical care granted. With our work we want to enable those concerned the access to health care.', null, null, null, null, null, 'en', '', null, null, null, null, '0', null, '2015-06-02 23:16:59', '2015-06-02 23:16:59');
