INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('1f555af1-1d10-4afd-af6e-f6eaaace006d', null, '556e1d2c4edab', 'Saxonia Systems AG', 'Come azienda incorporata nella società ci vogliamo anche noi, per quanto possibile, coinvolgere e assumere le nostre responsabilità. Noi siamo in stretta collaborazione con il consiglio per i rifugiati della sassonia e con l''agenzia del lavoro. In questo senso non siamo un''organizzazione con attività aperte al pubblico, ma abbiamo sempre un orecchio aperto e cerchiamo di aiutare attraverso i nostri contatti.', null, null, null, null, null, 'it', '', null, null, null, null, 'tedesco, inglese', null, '2015-06-02 23:16:52', '2015-06-02 23:16:52');
