INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('208a355d-871f-4685-9caf-23466bcc937a', null, '556e1d2d657b7', 'Arbeiterwohlfahrt (AWO) Beratung und Soziale Betreuung von Asylsuchenden ', 'Мы "KAMA Dresden e. V." позиционируем себя в качестве платформы для обмена культурными и образовательными предложениями. При этом предоставляются курсы, которые ведут мигранты, лица, получившие убежище, а также ищущие его. За содержательное оформление отвечают преподаватели курсов, объединение предлагает финансовую и организаторскую поддержку. Смысловая направленность разнообразна, например кулинарные курсы, языковые курсы, курсы ремесла, дискуссионные круги и так далее. Участие происходит на основе пожертвований. Мы работаем над динамичной сетью между работниками объединений, руководителями курсов и участниками этих курсов.', null, null, null, null, null, 'ru', '', null, null, null, null, 'немецкий, английский, французский, португальский (арабский, тигринья через посредников)', null, '2015-06-02 23:17:01', '2015-06-02 23:17:01');
