INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('34213275-550b-4e4b-ab68-26ae2ed08a54', null, '556e1d2d40468', 'medinetz', 'Le comité de défense des droits de l''homme Medinetz (association déclarée) propose une aide médicale anonyme et gratuit pour les réfugiés et les personnes sans visa, carte de séjour, passeport etc.  Nous sommes une association indépendante de citoyens, composée d''étudiants et de médecins engagés et nous sommes soutenus par beaucoup de médecins traitants, thérapeutes, psychologues, sages-femmes et interprètes. Notre objectif premier consiste à facilité l''accès aux soins des personnes sans papiers à Dresde et aux environs de Dresde, laquelle n''est pas garantie par l''Etat. L''accès à des soins médicaux appropriés est un des droits de l''homme, ce que l''on cherche de fait à cacher aux sans papiers à l''heure actuelle. Les demandeurs d''asile ne se voient offrir qu''un accès restreint aux soins médicaux. Par notre travail, nous voudrions garantir un accès aux soins aux personnes concernées.', null, null, null, null, null, 'fr', '', null, null, null, null, '0', null, '2015-06-02 23:16:58', '2015-06-02 23:16:58');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('3494339b-cf8f-45c0-9099-4b258d8b6d93', null, '556e1d2ea645d', 'Gruppe Cartonage', 'Initiative pour les droits des réfugié(e)s en Allemagne, apportant un regard critique sur les structures existantes et le traitement dont les réfugiés font l''objet', null, null, null, null, null, 'fr', '', null, null, null, null, '0', null, '2015-06-02 23:17:12', '2015-06-02 23:17:12');
