INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('3585835b-cac7-4f1e-9f46-bd27e9bdba53', null, '556e1d2b513d0', 'SPIKE Dresden', 'We organize help/support for asylum seekers in Leubnitz-Neuostra and other areas of the city. We offer a friendly and open place for meetings, leisure, social dedication, coordination of different porposals/offerings, support and for networking. Our rooms even can be used after the opening hours for special actions (e.g. mid morings). Every Sunday and Wednesday from 16.00 -20.00 (4-8pm) dedictated and interessted people are invited to meet to socialize/establish contact, meet asylum seekers and to plan common activities.', null, null, null, null, null, 'en', '', null, null, null, null, 'German, English', null, '2015-06-02 23:16:41', '2015-06-02 23:16:41');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('35b470f1-88e4-427b-ad7f-b1bdd9bebbb4', null, '556e1d2aa1087', 'Kontaktgruppe Asyl e.V.', 'Nous, membres du Groupe de Contact Asile (ndt: "Kontaktgruppe Asyl", abrégé KoGA), soutenons les demandeurs d''asile et les réfugiés à Dresde à surmonter les nombreuses barrières bureaucratiques et offrons des opportunités de contact et de rencontre. Nous aidons, avec respect, à joindre les forces et le potentiel de ces personnes et nous mettons à disposition en tant qu''interlocuteurs neutres. Publiquement, nous nous engageons contre les structures répressives et les préjugés racistes, ainsi que pour une société solidaire et diverse.', null, null, null, null, null, 'fr', '', null, null, null, null, 'Allemand, anglais, autres', null, '2015-06-02 23:16:35', '2015-06-02 23:16:35');
