INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('37f4c691-ee88-4b51-af13-977396c5e62f', 'a657ca53-59eb-41ad-b2eb-75d91dd6e6f5', '556e1d2b513d0', 'SPIKE Dresden', 'Wir organisieren konkrete Hilfe für Asylbewerber in Leubnitz-Neuostra und darüber hinaus. Wir bieten einen freundlichen und offenen Ort der Begegnung, für die Freizeitgestaltung, für soziales Engagement, zur Koordinierung von Angeboten, zur Unterstützung und als Anlaufstelle für Netzwerkpartner. Unsere Räume stehen auch über die Öffnungszeiten hinaus für Aktionen zur Verfügung (z.B. vormittags). Immer sonntags und mittwochs von 16-20 Uhr können sich Engagierte und Interessierte bei uns treffen, um Kontakte zu knüpfen, Asylsuchenden zu begegnen und besondere Aktivitäten und Angebote gemeinsam zu planen.', 'kontakt@spikedresden.de', 'http://www.spikedresden.de', 'http://www.facebook.com/SPIKEdresden', '0351/ 281 80 84', 3, 'de', 'Ellen Demnitz-Schmidt, Frank Meißner', 'Ellen Demnitz-Schmidt', '', 'logo', 0, 'Deutsch, Englisch', null, '2015-06-02 23:16:27', '2015-06-02 23:41:39');
