INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('4491f731-f2b8-496b-944a-ee487a0984f4', '8506e6e6-6c1f-4117-8236-12bbb154bedc', '556e1d2aa48d9', 'Laubegast ist Bunt', 'Das Bürgernetzwerk Laubegast ist Bunt bemüht sich bereits seit 2010 intensiv um Demokratieförderung, Weltoffenheit und Toleranz im Stadtteil. Seit 2014 ist die Flüchtlingshilfe einer der Arbeitsschwerpunkte.', 'vitae@cvjm-dresden.de', 'http://www.laubegast-ist-bunt.de', 'https://www.facebook.com/laubegastistbunt', '0157-87828576', 3, 'de', 'Claus Dethleff', 'Claus Dethleff', '', 'logo', 0, 'Deutsch, Englisch', null, '2015-06-02 23:16:26', '2015-06-02 23:36:52');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('453aa9f3-044e-4c8e-a61e-4d269ceea3b3', null, '556e1d2ad2e1e', 'Willkommen in Löbtau ቪልኮመን ኢን ሉብታው', 'ውሽጣዊ መርበብ "መርሓባ ናብ ሌብታው" ("Welcome to Löbtau") ኣብ ከባቢና ን ዝኣትዉ/ዝሰፍሩ ስደተኛታት ንምሕጋዝ ንደሊ። ኣብ ሞንጎ ስደተኛታትን ደቒ ዓድን ርክብ ንምምስራት ንደሊ። እዚ መርበብ ውፍያት ደቒ ዓድን: ክርስትያናዊ ማሕበራት: ማሕበራት/ክለባት ከምኡ''ውን (ፖሎቲካዊ) ፓርትታት።', null, null, null, null, null, 'ti', '', null, null, null, null, 'ቋንቋታት ኢንግሊዝ: ጀርመን: ፈረንሳይ', null, '2015-06-02 23:16:37', '2015-06-02 23:16:37');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('45ab6cf7-ede9-465f-a523-4f13ee0d1403', null, '556e1d2c4edab', 'Saxonia Systems AG ዛክሶኒያ ሲስተምስ ኤ.ጂ.', 'ኣብ ሕብረተሰብ ዝተሰረተ ትካል ስለትኾንና ኣብ ከምዚ ንጥፈታት ከነበርክት  እጃምና ከነልዕልን ንደሊ። ምስ ቤት ምኽሪ ስደተኛታት ዛክሰንን (Sächischen Flüchtlingsrat) ቤት ጽሕፈት ዕዮን (Arbeitsagentur) ብቐረባ እንዳተሓባበርና ንሰርሕ። እዚ ማለት ክፉት ዝኾነ ንጥፈታት ዘለና ክለብ ኣይኮንናን  እንተኾነ ግን ብክፉት እዝኒ ንሰምዕ ብመንገዲ ርክባትና ሽግራት ክንፈትህ ንፍትን። ', null, null, null, null, null, 'ti', '', null, null, null, null, 'ቋንቋታት ኢንግሊዝን ጀርመንን', null, '2015-06-02 23:16:52', '2015-06-02 23:16:52');
