INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('51284387-9834-4b61-bde6-681e038369bb', null, '556e1d2b513d0', 'SPIKE Dresden', 'Organizziamo un aiuto concreto per asilanti in Leubnitz-Neuostra e luoghi circostanti. Offriamo un luogo amichevole ed aperto dell''incontro, per il tempo libero, impegno sociale, coordinazione di offerte, supporto e come punto d''incontro di altre reti sociali. Le nostro sale sono a disposizione anche oltre il nostro orario di apertura per azioni sociali. Sempre la domenica e il mercoledì dalle 16 alle 20 si possono incontrare volontari e interessati da noi per stabilire contatti, incontrare asilanti e per progettare attività e offerte insieme.', null, null, null, null, null, 'it', '', null, null, null, null, 'tedesco, inglese', null, '2015-06-02 23:16:42', '2015-06-02 23:16:42');
