INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('a4284ab9-54d7-4586-9b79-5823e7c9022d', null, '556e1d2aa1087', 'Kontaktgruppe Asyl e.V.', 'Mi clanovi kontaktne grupe ,,Asylum" (skraćeno KoGA), podržavamo azilante i izbeglice iz Drezdena da prevaziđu administrativne barijere i da ostvare prilike za stvaranje kontakata i sastanaka. Sa poštovanjem, mi radimo na snazi i potencijalu ovih ljudi i pružamo im pomoć kao zastupnici. Vodimo otvorenu kampanju protiv orepresivnih struktura i rasističkih predrasuda promovišući otvoreno i raznobojno društvo.', null, null, null, null, null, 'sr', '', null, null, null, null, 'Nemački, engleski, drugi', null, '2015-06-02 23:16:35', '2015-06-02 23:16:35');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('a4354142-65d9-4365-9a2e-06f77cc603ae', null, '556e1d2aa1087', 'Kontaktgruppe Asyl e.V.', 'Мы участники контактной группы "Убежище" (сокращенно KoGA) поддерживаем ищущих убежища и беженцев в Дрездене в преодолении множества бюрократических преград и создаем возможности для встреч и контактов. Мы с уважением обращаемся с потенциалом и сильными сторонами этих людей и предоставляем свои услуги в качестве независимых контактных лиц. Публично мы активно боремся против репрессивных структур и расистских предрассудков, а также выступаем за солидарное и разнородное общество.', null, null, null, null, null, 'ru', '', null, null, null, null, 'немецкий, английский, другие', null, '2015-06-02 23:16:35', '2015-06-02 23:16:35');
