INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('a7b4488b-13a4-4c64-a3d7-0b6193f1c11a', null, '556e1d2d657b7', 'KAMA Dresden e.V.', 'Noi ci concepiamo come una piattaforma per lo scambio attraverso offerte culturali e di educazione. I corsi sono tenuti da asilanti, migranti. La progettazione del contenuto spetta completamente agli istruttori, l''associazione offre solo un supporto finanziario o organizzativo. I temi dei corsi sono vari, ad esempio corsi di cucina, di lingua, di artigianato etc. La partecipazione è a base di donazioni libere. Lavoriamo a una viva cooperazione tra i collaboratori dell''associazione, gli istruttori e i partecipanti. ', null, null, null, null, null, 'it', '', null, null, null, null, 'tedesco, inglese, francese portogese (arabo, tigrino)', null, '2015-06-02 23:17:02', '2015-06-02 23:17:02');
