INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('ac8fbe3b-fe9f-403a-98c6-0c8dde0e9469', null, '556e1d2aa1087', 'Kontaktgruppe Asyl e.V. ኮንታክትግሩፐ ኣዙል ኢ.ፋው.', 'ንሕና ኣባላት ርክብ ጉጅለ ዑቅባ (e. V.; short KoGA) : ንሓተቲ ዑቕባን ስደተኛታትን ኣብ ድረስደን (Dresden) ኣብ ምምሕዳራዊ መዳይ ንዝሀሉ ማሕለኻታት ንምብዳህ ንሕግዝ ከምኡ''ውን  ዕድላት ናይ ርክብን ኣኼባታትን ኣብ መፍጣር ንተሓጋገዝ። ሓያል ጎንታትን ዓቕምን ናይዞም ሰባት ኣብ መህናጽን ከም ወኪል ኮይንና ምዝራብን ንተሓጋገዝ። ኣንጻር ጨቓኒ መስርዕን ዓሌታዊ ኣድልዎን ዘመተ ነካይድ ከምኡ''ውን ን ክፉትን ሕብራውን ሕብረተሰብ ንድግፍ ።', null, null, null, null, null, 'ti', '', null, null, null, null, 'ቋንቋታት ኢንግሊዝን ጀርመንን ክልኦትን', null, '2015-06-02 23:16:35', '2015-06-02 23:16:35');
