INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('cdd3b3a1-d85f-4b84-8b97-57e05708d5ba', null, '556e1d2b513d0', 'SPIKE Dresden', 'Nous organisons de l’aide concrète pour les demandeurs d’asile à Leubnitz-Neuostra et alentours. Nous offrons un lieu convivial et ouvert aux rencontres, aux loisirs, à l''engagement social, à la coordination des offres, au soutien et adresse pour des partenaires du réseau. Nos locaux sont à la disposition pendant les heures d''ouverture et en dehors pour des actions (par exemple dans la matinée). Tous les dimanches et mercredis de 16-20 heures, les bénévoles et les intéressés peuvent se rencontrer chez nous, pour nouer des contacts, rencontrer des demandeurs d''asile et planifier des activités particulières et des offres communes.', null, null, null, null, null, 'fr', '', null, null, null, null, 'allemand, anglais', null, '2015-06-02 23:16:41', '2015-06-02 23:16:41');
