INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('e6550bf7-1152-436a-849a-a8b9a41be789', null, '556e1d2ccf2da', 'LAG politisch-kulturelle Bildung Sachsen e. V.', 'Ci occupiamo da molti anni con il tema razzismo, migrazione, fuga e asilo e offriamo formazioni per dipendenti a tempo pieno e volontari. In primo piano viene posta la domanda, come possiamo agire il più efficacemente possibile contro il razzismo. Inoltre offriamo dei seminari di rinvigorimento per persone, che sono state colpite negativamente dal razzismo. Eventi, contenuti e necessità concrete possono essere accordate.', null, null, null, null, null, 'it', '', null, null, null, null, 'tedesco, inglese, (russo, ucraino, spagnolo, portoghese)', null, '2015-06-02 23:16:56', '2015-06-02 23:16:56');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('e67588f0-53c0-4332-95e5-59f00af98630', null, '556e1d2b513d0', 'SPIKE Dresden', 'ہم لیوبناٹز-نیووسٹرا اور شہر کے دیگر علاقوں میں پناہ کے متلاشیوں کے لیے مدد/معاونت کا انتظام کرتے ہیں ۔ ہم الگ الگ ملاقاتوں، تفریح، سماجی لگن، کاوشوں کی مختلف پارپوسالس/قربانیوں، حمایت اور نیٹ ورکنگ کے لئے ایک دوستانہ اور کھلی جگہ پیش کرتے ہیں ۔ ہمارے کمرے بھی بعد کھلنے کا وقت (مورینگس) وسط مثلا خصوصی اعمال کے لیے استعمال کیا جا سکتا ہے ۔ ہر اتوار اور بدھ کے روز داداکتٹید 16.00-20.00 (4-8 بجے) اور انٹریسٹید لوگوں سے ہیں مدعو دنیاء/قائم رابطہ، پناہ کے متلاشیوں کو پورا کرنے اور مشترکہ سرگرمیوں کی منصوبہ بندی کو پورا کرنے کے لئے ۔', null, null, null, null, null, 'ur', '', null, null, null, null, 'جرمن, انگریزی', null, '2015-06-02 23:16:41', '2015-06-02 23:16:41');
