INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('e9704afc-1c82-4002-be08-476302b623ea', '8506e6e6-6c1f-4117-8236-12bbb154bedc', '556e1d2ad83b5', 'Initiative "Brücken schaffen"', 'Die Initiative "Brücken schaffen" ist die Zusammenarbeit von Vereinen, Kirchen, Parteien, Ortsamt aus Klotzsche, Hellerau, Langebrück, mit dem Ziel, das Zusammenleben von EinwohnerInnen und Asylsuchenden und die Integration und Ankunft der Asylsuchenden harmonisch zu gestalten.', 'kontakt@bruecken-schaffen.de', 'http://www.bruecken-schaffen.de/', '', '', 3, 'de', 'Ulrike Caspary und Anja Apel', 'Anja Apel und Ulrike Caspary', '', 'logo', 0, 'Deutsch, Englisch, Französisch', null, '2015-06-02 23:16:26', '2015-06-02 23:33:25');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('e9badc70-a6a0-462c-8f6f-0e108c3747a1', null, '556e1d2b97066', 'Willkommen in Hochland', 'Le but de la création de notre association est l''amélioration des conditions des réfugiés et demandeurs d''asile à Dresde et dans les régions voisines. Dans cette optique, nous proposons principalement du soutien et de l’aide à l’arrivée, pour une meilleure intégration des nouveaux habitants. Mais aussi des consultations, prises en charge, développement de projets de travail, organisation de fêtes interculturelles, etc.', null, null, null, null, null, 'fr', '', null, null, null, null, 'allemand, anglais', null, '2015-06-02 23:16:44', '2015-06-02 23:16:44');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('ea55f1d6-d204-4038-901d-2f8f8d1778c7', '8506e6e6-6c1f-4117-8236-12bbb154bedc', '556e1d2d657b7', 'KAMA Dresden e.V.', 'Wir als KAMA Dresden e.V. verstehen uns als eine Plattform für Austausch durch Kultur- und Bildungsangebote. Dabei werden Kurse VON Asylsuchenden, Migrant_innen und Asylberechtigten angeboten. Die inhaltliche Gestaltung obliegt den Kursleiter_innen, der Verein bietet finanzielle und organisatorische Unterstützung. Die inhaltliche Ausrichtung ist divers, z.B. Kochkurse, Sprachkurse, Handwerkskurse,Diskussionsrunden,usw. Die Teilnahme findet auf Spendenbasis statt. Wir arbeiten an einem lebendigen Netzwerk zwischen den Mitarbeitenden des Vereins, den Kursleitenden und den Teilnehmenden.', 'kama-dresden@riseup.net', 'http://www.kama-dresden.org', 'https://www.facebook.com/kamadresden?fref=ts', '', 3, 'de', '', 'Carmen Burkel', '', 'logo', 0, 'Deutsch,Englisch,Französisch,Portugiesisch (Arabisch, Tigrinia nach Weiterleitung)', null, '2015-06-02 23:16:29', '2015-06-02 23:35:39');
