INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f319f8f1-0e71-4949-a78c-22791bcebb9e', null, '556e1d2b513d0', 'SPIKE Dresden', 'Мы организуем реальную помощь для лиц, ищущих убежища в Лёйбниц-Нойостра и за его пределами. Мы предлагаем благоприятное и открытое место для встреч, организации свободного времени, социально-активной деятельности, координированию предложений, поддержки, а также в качестве места встречи партнеров ассоциации. Наши помещения предоставляются для деятельности за рамками рабочего времени (например до полудня). Каждые воскресенье и среду с 16 до 20 часов активисты и заинтересованные граждане могут встречаться у нас, чтобы завязать контакты, встретиться с людьми, ходатайствущими о предоставлении убежища, и совместно спланировать специальные мероприятия и предложения.', null, null, null, null, null, 'ru', '', null, null, null, null, 'немецкий, английский', null, '2015-06-02 23:16:41', '2015-06-02 23:16:41');
