INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f6dd374d-021a-4817-b9b8-4b78bda9db74', '85be42e3-e597-44c1-b743-bb675169d94c', '556e1d2aa1087', 'Kontaktgruppe Asyl e.V.', 'Wir, die Mitglieder der Kontaktgruppe Asyl (e. V.; kurz KoGA), unterstützen Asylsuchende und Geflüchtete in Dresden beim Bewältigen der vielen bürokratischen Hürden und schaffen Kontakt- und Begegnungsmöglichkeiten. Mit Respekt knüpfen wir an die Stärken und Potentiale dieser Menschen an und stellen uns als unabhängige AnsprechpartnerInnen zur Verfügung. Öffentlich engagieren wir uns gegen repressive Strukturen und rassistische Vorurteile sowie für eine solidarische und bunte Gesellschaft.', 'kontaktgruppe-asyl@web.de', 'http://kontaktgruppeasyl.blogsport.de/', 'https://www.facebook.com/kontaktgruppeasyl', '', 3, 'de', '', '', '', 'logo', 0, 'Deutsch, Englisch, weitere', null, '2015-06-02 23:16:26', '2015-06-02 23:36:19');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f76440e5-2eae-41d7-859b-bf8c946d92a7', null, '556e1d2a5bfb0', 'Bündnis Buntes Radebeul', 'Kurseve nemačkog, različite težine, drže dobrovoljni nastavnici, što uključuje osnovni kurs alfabeta, postizanje A1/A2 nivoa kao osnov3 za državni test jezika, praćen grupama za vežbanje. Podrška i pratnja u radu sa vlastima, odlaska kod doktora, poslodavaca itd. Organizacija sporta i kulturnih aktivnosti, kao i zanatskih delatnosti (nem. "handwerklicher Tätigkeiten"). Mesečni sastanci u centralnom smeštaju za izbeglice u Radebulu (nemački Radebeul).', null, null, null, null, null, 'sr', '', null, null, null, null, 'Nemački, engleski', null, '2015-06-02 23:16:34', '2015-06-02 23:16:34');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f8184542-2050-460b-b248-11f67e23a9ff', null, '556e1d2ccf2da', 'LAG politisch-kulturelle Bildung Sachsen e. V.', 'В течение многих лет мы работаем над темами расизма, миграции, бегства и убежища и предлагаем повышение уровня знаний для людей, занимающихся просветительской работой на общественных началах, а также для профессиональных преподавателей-общественников. При этом стоит вопрос, как мы сами на переднем плане можем действовать наиболее критично в отношении расизма. Также мы предлагаем семинары по созданию условий для полноправного участия в жизни общества для лиц, которые пострадали от расизма. Время, содержание, конкретные требования могут быть обсуждены.    ', null, null, null, null, null, 'ru', '', null, null, null, null, 'немецкий, английский (русский, украинский, испанский, португальский через посредников)', null, '2015-06-02 23:16:56', '2015-06-02 23:16:56');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f8ce042f-2e99-4e49-b047-31738f5aa249', null, '556e1d2c4edab', 'Saxonia Systems AG', 'As an enterprise that is established in society we would like to do our possible part and to take on responsibility. We work close with the Saxon Refugee Council and the Federal Employment Agency. Hence, we are not an association with open activities but we like to offer our support through our network.', null, null, null, null, null, 'en', '', null, null, null, null, 'German, English', null, '2015-06-02 23:16:51', '2015-06-02 23:16:51');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f8d78266-0fc4-4d3b-a433-9ee45561d010', null, '556e1d2a598c7', 'DAMF Deutschkurse für Asylsuchende', 'Kursevi nemačkog počevši od alfabeta do kraja A1 nivoa, kroz šest nivoa teškoće, za azilante koji još uvek nemaju pravo na ESF ili integracione kurseve. Šesdest dobrovoljnih nastavnika će držati oko trideset kurseva nemačkog. Početak novog kursa i test provere znanja se održavaju četiri puta godišnje.', null, null, null, null, null, 'sr', '', null, null, null, null, '', null, '2015-06-02 23:16:33', '2015-06-02 23:16:33');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('f9508e1b-2686-4454-8cf9-94ffd19af2e2', null, '556e1d2c45abc', 'Prohlis ist bunt', 'نیٹ ورک ''پروہلاس یکم bunt'' (''پروہلاس ہے رنگین'') ایک یونین کلب، اداروں، شہر ضلع بیورو، سہ ماہی کا انتظام، چرچ ایسوسی ایشن اور جماعتوں کی پروہلاس میں ہے اور اس علاقے میں استقبال ماحول تخلیق کرنے کا مقصد ہے ۔ اہم کاموں میں نیٹ ورکنگ اور منصوبے کی سرگرمیوں ہیں. موسم بہار 2014 کے بعد سے نیٹ ورک موجود ہے ۔', null, null, null, null, null, 'ur', '', null, null, null, null, 'جرمن, انگریزی', null, '2015-06-02 23:16:50', '2015-06-02 23:16:50');
