INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('fe410ba7-b1bf-429c-83f2-edcd05dcd6f9', null, '556e1d2ad83b5', 'Initiative "Brücken schaffen"', 'Inicijativa "Brücken schaffen" (,,Izgradimo mostove) je kooperacija između crkvenih parošana, organizacija/klubova, političkih partija i lokalne centralne kancelarije ("Ortsamt") gradskih okruga Kloše, Langebruk i Helerau (nemački Klotsche, Langebrück i Hellerau). Želimo da učinimo dolazak, integraciju i zajednički život sa građanima što lakšim i harmoničnijim mogućim za izbeglice i azilante.', null, null, null, null, null, 'sr', '', null, null, null, null, 'Nemački, engleski, francuski', null, '2015-06-02 23:16:37', '2015-06-02 23:16:37');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('fe6f5c00-4aa7-453f-b985-5a971f5bd8b4', null, '556e1d2cd0160', 'Netzwerk Asyl Migration Flucht (NAMF)', 'Political initiative for the rights of fugitives and migrants and against racism. We have a mail list with which individuals and groups can share information and organize themselves. To join the list: mail to namf@notraces.net ', null, null, null, null, null, 'en', '', null, null, null, null, '0', null, '2015-06-02 23:16:57', '2015-06-02 23:16:57');
INSERT INTO `neos-dd4all`.ddfa_main_domain_model_initiative (persistence_object_identifier, category_id, entry_id, name, description, mail, web, facebook, phone, rating, locale, speakerpublic, speakerprivate, image, imagetype, supportwanted, spokenlanguages, published, created, updated) VALUES ('ff8b2c90-4aa1-41a9-8fd6-61dbf4d8351f', null, '556e1d2d40468', 'medinetz', 'The Human Rights Initiative Medinetz Dresden e.V. provides anonymous and free medical care for refugees and for migrants without documents.
